const storedProjectList=JSON.parse(localStorage.getItem("projectList")),projectsElement=document.getElementById("projects");for(let e=0;e<storedProjectList.length;e++){let t=storedProjectList[e];projectsElement.innerHTML+=`\n        <article class="project">\n            <h2 class="project-name">${t.name}</h2>\n            <p class="project-date"><b>Date Completed:</b> ${t.date_completed}</p>\n            <p class="project-tech"><b>Technologies Used:</b> ${t.technologies_used}</p>\n            <p class="project-team"><b>Teammates (if applicable):</b> ${t.teammates}</p>\n            <p class="project-description">${t.description}</p>\n        </article>\n        `}